import React, {useState, useEffect} from "react";

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('/api')
    .then(res => res.json())
    .then(res => setData(...res.table))
  }, []);

  return (
    <div className="container">
      {
          !data ? "Loading..." : data.forEach(e => e)
      }
    </div>
  );
}

export default App;
